import Todo from "./Todo";

const TodoList = function ({ todos, setTodos, filteredTodos }) {
    return (
        <div className="todo-container">
            <ul className="todo-list"> {todos.map(todo => (
                <Todo
                text={todo.text}
                key={todo.id}
                todo={todo}
                todos={todos}
                setTodos={setTodos}
                />
            ))}</ul>
        </div> 
    );
};

export default TodoList;
